INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (1, 1, N'El diseño del Sistema de Gestión de Seguridad y Salud en el Trabajo, para empresas de diez (10) o menos trabajadores clasificadas en Riesgo I, II, III, podrá ser realizado por técnicos o tecnólogos en seguridad y Salud en el Trabajo o en alguna de sus áreas, con licencia vigente en Salud Ocupacional o Seguridad y Salud en el Trabajo que acrediten mínimo dos (2) años de experiencia en el desarrollo de actividades de Seguridad y Salud en el Trabajo y que acrediten la aprobación del curso de capacitación virtual de cincuenta (50) horas.
Para empresas de diez (10) o menos trabaja dores clasificadas en Riesgo IV y V, podrá ser realizado por un Profesional en Salud Ocupacional o Seguridad y Salud en el Trabajo, profesional con posgrado en Seguridad y Salud en el Trabajo, con licencia en Salud Ocupacional o Seguridad y Salud en el Trabajo vigente y que acrediten la aprobación del curso de capacitación virtual de cincuenta (50) horas.
La persona que diseñe, ejecute e implemente el Sistema de Gestión de Seguridad y Salud en el Trabajo tenga la formación y cursos solicitada en los artículos 5 y 6 de la presente resolución.', N'1.1.1 Responsable del Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST', N'1.1.1', N'Decreto 1607/2002 Decreto 1072/2015, Artículo. 2.2.4.6.8 numerales 2 y 10. Resolución 4502/2012 Decreto 1295/1994, Artículo. 26. Artículos 5 y 6 de la presente resolución', N'Solicitar el documento en el que consta la designación del responsable del Sistema de Gestión de Seguridad y Salud en el Trabajo, con la respectiva asignación de responsabilidades y solicitar el certificado correspondiente, que acredite la formación de acuerdo con lo establecido en el presente criterio.
Se solicita el título de formación de técnico, tecnólogo, profesional, especialista o maestría en Seguridad y Salud en el Trabajo. Se verifica la licencia en Seguridad y Salud en el Trabajo vigente.
Se constata la existencia del certificado de aprobación del curso virtual de cincuenta (50) horas en Seguridad y Salud en el Trabajo. A quien no tenga licencia se le solicita que cumpla los requisitos de formación y cursos solicitada en los artículos 5 y 6 de la presente resolución.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (2, 1, N'La empresa asignó y documentó las responsabilidades específicas en el Sistema de Gestión de Seguridad y Salud en el Trabajo a todos los niveles de la organización, para la implementación y mejora continua del Sistema de Gestión de Seguridad y Salud en el Trabajo.', N'1.1.2 Responsabilidades en el Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST.', N'1.1.2', N'Decreto 1072/2015 Artículo 2.2.4.6.8 numeral 2, Artículo 2.2.4.6.12 numeral 2', N'Solicitar el soporte que contenga la asignación y documentación de las responsabilidades en Seguridad y Salud en el Trabajo.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (3, 1, N'La empresa define y asigna los recursos financieros, humanos, técnicos y tecnológicos, requeridos para la implementación, mantenimiento y continuidad del Sistema de Gestión de Seguridad y Salud en el Trabajo.', N'1.1.3 Asignación de recursos para el Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST', N'1.1.3', N'Decreto 1072/2015, Artículo 2.2.4.6.8. numeral 4, Artículo 2.2.4.6.17 numeral 2.5.', N'Constatar la existencia de evidencias físicas y/o documentales que demuestren la definición y asignación de los recursos financieros, humanos, técnicos y de otra índole para la implementación, mantenimiento y continuidad del Sistema de Gestión de Seguridad y Salud en el Trabajo, evidenciando la asignación de recursos con base en el plan de trabajo anual.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (4, 1, N'Todos los trabajadores, independientemente de su forma de vinculación o contratación están afiliados al Sistema General de Riesgos Laborales y el pago de los aportes se realiza conforme a la normativa y en la respectiva clase de riesgo.', N'1.1.4 Afiliación al Sistema General de Riesgos Laborales', N'1.1.4', N'Decreto 2090/2003 Artículo 5°. Ley 1562/2012 Artículos 2°, 6° y 7°. Decreto 1295/1994 Artículos 4, 16, 21 y 23. Decreto 1072/2015 Artículos:2.2.4.2.2.5. 2.2.4.2.2.6. 2.2.4.2.2.13. 2.2.4.2.3.4. 2.2.4.2.4.3. 2.2.4.3.7. 2.2.4.6.28. numeral 3. 2.2.1.6.1.3. 2.2.1.6.1.4. 2.2.1.6.4.6. 2.2.1.6.4.7. Ley 1150/2007 Artículo 23.', N'Solicitar una lista de los trabajadores vinculados laboralmente a la fecha y comparar con la planilla de pago de aportes a la seguridad social de los cuatro (4) meses anteriores a la fecha de verificación. Realizar el siguiente muestreo:
De uno (1) a diez (10) trabajadores verificar el 100%.
Entre once (11) y cincuenta (50) trabajadores verificar el 20%.
Entre cincuenta y uno (51) y doscientos (200) trabajadores verificar el 10%
Mayores a doscientos un (201) trabajadores verificar el registro de 30 trabajadores.
Solicitar una lista de los trabajadores vinculados por prestación de servicios a la fecha y comparar con la última planilla de pago de aportes a la seguridad social suministrada por los contratistas. Tomar:
De uno (1) a diez (10) trabajadores verificar el 100%.
Entre once (11) y cincuenta (50) trabajadores verificar el 20%.
Entre cincuenta y un (51) y doscientos (200) trabajadores verificar el 10%
Mayores a doscientos un (201) trabajadores verificar el registro de 30 trabajadores.
De la muestra seleccionada verifique la afiliación al Sistema General de Seguridad Social.
En los casos excepcionales de trabajadores independientes que se afilien a través de agremiaciones verificar que corresponda a una agremiación autorizada por el Ministerio de Salud y Protección Social, conforme al listado publicado en la página web del Ministerio del Trabajo o del Ministerio de Salud y Protección Social.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (5, 1, N'Si aplica, se tienen plenamente identificados los trabajadores que se dediquen en forma permanente al ejercicio de las actividades de alto riesgo establecidas en el Decreto 2090 de 2003 o de las normas que lo adicionen, modifiquen o complementen y se les está cotizando el monto establecido en la norma al Sistema de Pensiones.
Verificar si la empresa con la asistencia de la Administradora de Riesgos Laborales está cumpliendo con lo establecido en la presente resolución para actividades de alto riesgo.', N'1.1.5 Pago de pensión trabajadores alto riesgo', N'1.1.5', N'Decreto 2090 de 2003', N'Si aplica, se tienen plenamente identificados los trabajadores que se dediquen en forma permanente al ejercicio de las actividades de alto riesgo establecidas en el Decreto 2090 de 2003 o de las normas que lo adicionen, modifiquen o complementen y se les está cotizando el monto establecido en la norma al Sistema de Pensiones.
Verificar si la empresa con la asistencia de la Administradora de Riesgos Laborales está cumpliendo con lo establecido en la presente resolución para actividades de alto riesgo.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (6, 1, N'La empresa cuenta, de acuerdo con el número de trabajadores con:
Vigía en Seguridad y Salud en el Trabajo para empresas de menos de diez (10) de trabajadores.
Comité Paritario en Seguridad y Salud en el Trabajo para empresas de diez (10) o más trabajadores', N'1.1.6 Conformación COPASST / Vigía.', N'1.1.6', N'Resolución 2013/1986 Arts. 2, 3 y 11. Resolución 1401/2007 Artículo 4° numeral 5 y Artículo 7°. Decreto 1295/1994 Artículo 35 literal c), Artículo 63. Decreto 1072/2015 Artículos:
2.2.4.1.6. 2.2.4.6.2. parágrafo 2, 2.2.4.6.8. numeral 9, 2.2.4.6.11. parágrafo 1, 2.2.4.6.12. numeral 10, 2.2.4.6.32. parágrafo 2, 2.2.4.6.34. numeral 4', N'Solicitar el acta mediante la cual se designa el Vigía de Seguridad y Salud en el Trabajo o solicitar los soportes de la convocatoria, elección, conformación del Comité Paritario de Seguridad y Salud en el Trabajo y el acta de constitución.
Constatar si es igual el número de representantes del empleador y de los trabajadores y revisar si el acta de conformación se encuentra vigente, para el caso en que proceda la constitución del Comité.
Solicitar las actas de reunión mensuales del último año del Comité Paritario o los soportes de las gestiones adelantadas por el Vigía de Seguridad y Salud en el Trabajo, y verificar el cumplimiento de sus funciones.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (7, 1, N'El Vigía en Seguridad y Salud en el Trabajo y los miembros del Comité Paritario en Seguridad y Salud en el Trabajo y sus respectivos miembros (Principales y Suplentes) se encuentran capacitados para poder cumplir las responsabilidades que les asigna la ley.', N'1.1.7 Capacitación COPASST / Vigía.', N'1.1.7', N'Decreto 1072/2015 Artículos: 2.2.4.6.2. parágrafo 2, 2.2.4.6.8. numeral 9, 2.2.4.6.11. parágrafo 1, 2.2.4.6.12. numeral 10, 2.2.4.6.32. parágrafo 2, 2.2.4.6.34. numeral 4', N'Solicitar registros que constaten la capacitación y evaluación tanto para el Vigía en Seguridad
y Salud en el Trabajo o para los miembros del Comité Paritario en Seguridad y Salud en el Trabajo según aplique que estén vigentes.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (8, 1, N'La empresa conformó el Comité de Convivencia Laboral y este funciona de acuerdo con la normativa vigente.', N'1.1.8 Conformación Comité Convivencia.', N'1.1.8', N'Resolución 652/2012 Arts. 1, 2, 6, 7 y 8. Resolución1356/2012 Artículo 1°, 2° y 3°', N'Solicitar el documento de conformación del Comité de Convivencia Laboral y verificar que esté conformado de acuerdo a la normativa y que su período de conformación se encuentra vigente.
Solicitar las actas de las reuniones (como mínimo una reunión cada tres meses) y los informes de Gestión del Comité de Convivencia Laboral, verificando el desarrollo de sus funciones.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (9, 2, N'Se cuenta con un programa de capacitación anual en promoción y prevención, que incluye los peligros/riesgos prioritarios, extensivo a todos los niveles de la organización y el mismo se ejecuta.', N'1.2.1 Programa Capacitación Promoción y Prevención - PyP.', N'1.2.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.11, 2.2.4.6.12 numeral 6', N'Solicitar el programa de capacitación anual y la matriz de identificación de peligros y verificar que el mismo esté dirigido a los peligros ya identificados, con la evaluación y control del riesgo, y/o necesidades en Seguridad y Salud en el Trabajo, y verificar las evidencias de su cumplimiento.
Verificar si el Comité Paritario en Seguridad y Salud en el Trabajo o Vigía en Seguridad y Salud en el Trabajo participó en la revisión anual del plan de capacitación.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (10, 2, N'Todos los trabajadores, independientemente de su forma de vinculación y/o contratación y de manera previa al inicio de sus labores, reciben capacitación, inducción y reinducción en aspectos generales y específicos de las actividades por realizar que incluya entre otros, la identificación de peligros y control de los riesgos en su trabajo, y la prevención de accidentes de trabajo y enfermedades laborales.
Asimismo, se proporcionan las capacitaciones en Seguridad y Salud en el Trabajo de acuerdo con las necesidades identificadas.', N'1.2.2 Capacitación, Inducción y Reinducción en Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST, actividades de Promoción y Prevención - PyP.', N'1.2.2', N'Decreto 1072/2015 Artículos: 2.2.4.6.8. numeral 8, 2.2.4.6.11. parágrafo 2, 2.2.4.6.12. numeral 6, 2.2.4.6.13. numeral 4, 2.2.4.6.28. numeral 4. 2.2.4.2.4.2. Resolución 2400/1979 Artículo 2°. literal g).', N'Solicitar la lista de trabajadores, independientemente de su forma de vinculación y/o contratación y verificar los soportes documentales que den cuenta de la capacitación y de su evaluación, de la inducción y reinducción de conformidad con el criterio. La referencia es el Plan de capacitación, su cumplimento y la cobertura de los trabajadores objeto de cada tema.
Para realizar la verificación tener en cuenta:
De uno (1) a diez (10) trabajadores verificar el 100%
Entre once (11) y cincuenta (50) trabajadores verificar el 20%
Entre cincuenta y uno (51) y doscientos (200) trabajadores verificar el 10% Mayores a doscientos un (201) trabajadores verificar el registro de 30 trabajadores.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (11, 2, N'Los responsables del Sistema de Gestión de Seguridad y Salud en el Trabajo cuentan con el certificado de aprobación del curso de capacitación virtual de cincuenta (50) horas definido por el Ministerio del Trabajo', N'1.2.3 Responsables del Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST con curso (50 horas).', N'1.2.3', N'Decreto 1072/2015 Artículo. 2.2.4.6.35', N'Solicitar el certificado de aprobación del curso de capacitación virtual de cincuenta (50) horas definido por el Ministerio de Trabajo, expedido a nombre del responsable del Sistema de Gestión de Seguridad y Salud en el Trabajo')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (12, 3, N'En el Sistema de Gestión de Seguridad y Salud en el Trabajo (SG-SST) se establece por escrito la Política de Seguridad y Salud en el Trabajo, es comunicada al Comité Paritario de Seguridad y Salud en el Trabajo o al Vigía de Seguridad y Salud en el Trabajo. La Política es fechada y firmada por el representante legal, expresa el compromiso de la alta dirección, el alcance sobre todos los centros de trabajo y todos sus trabajadores independientemente de su forma vinculación y/o contratación, es revisada, como mínimo una vez al año, hace parte de las políticas de gestión de la empresa, se encuentra difundida y accesible para todos los niveles de la organización.
Incluye como mínimo el compromiso con:
La identificación de los peligros, evaluación y valoración de los riesgos y establece los respectivos controles.
Proteger la seguridad y salud de todos los trabajadores, mediante la mejora continua
El cumplimiento de la normativa vigente aplicable en materia de riesgos laborales.', N'2.1.1 Política del Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST firmada, fechada y comunicada al COPASST/Vigía.', N'2.1.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.5. 2.2.4.6.6. 2.2.4.6.7. 2.2.4.6.8. Numeral 1', N'Solicitar la política del Sistema de Gestión de Seguridad y Salud en el Trabajo (SG-SST), de la empresa y confirmar que cumpla con los aspectos contenidos en el criterio. Validar para la revisión anual de la política como mínimo: Fecha de emisión, firmada por el representante legal actual, que estén incluidos los requisitos normativos actuales o directrices de la empresa.
Entrevistar a los miembros del Comité Paritario de Seguridad y Salud en el Trabajo o Vigía de Seguridad y Salud en el Trabajo para indagar el entendimiento de la política en Seguridad y Salud en el Trabajo. Como referencia preguntar:
Si conocen los peligros, evaluación y valoración de los riesgos y se establecen los respectivos controles.
Si se realizan actividades de Promoción y Prevención.
Si la empresa aplica la normativa legal vigente en materia de riesgos laborales.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (13, 4, N'Están definidos los objetivos del Sistema de Gestión de Seguridad y Salud en el Trabajo y ellos se expresan de conformidad con la política de Seguridad y Salud en el Trabajo, son claros, medibles, cuantificables y tienen metas, coherentes con el plan de trabajo anual, compatibles con la normativa vigente, se encuentran documentados, son comunicados a los trabajadores, son revisados y evaluados mínimo una vez al año, actualizados de ser necesario, están acordes a las prioridades definidas y se encuentran firmados por el empleador.', N'2.2.1 Objetivos definidos, claros, medibles, cuantificables, con metas, documentados, revisados del SG-SST.', N'2.2.1', N'Decreto 1072/2015, Artículos: 2.2.4.6.12. numeral 1, 2.2.4.6.17. numeral 2.2 2.2.4.6.18.', N'Revisar si los objetivos se encuentran definidos, cumplen con las condiciones mencionadas en el criterio y existen evidencias del proceso de difusión.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (14, 5, N'La empresa realizó la evaluación inicial del Sistema de Gestión de Seguridad y Salud en el Trabajo, identificando las prioridades para establecer el plan de trabajo anual o para la actualización del existente y fue realizada por el responsable del Sistema de Gestión de Seguridad y Salud en el Trabajo o si fue contratada, por la empresa con personal externo con licencia en Salud Ocupacional o Seguridad y Salud en el Trabajo o conforme, verificando que la persona que diseñe, ejecute e implemente el Sistema de Gestión de Seguridad y Salud en el Trabajo tenga la formación y cursos solicitada en los artículos 5° y 6° de la presente resolución.', N'2.3.1 Evaluación e identificación de prioridades.', N'2.3.1', N'Decreto 1072/2015 Artículo. 2.2.4.6.16. Resolución 4502/2012 Artículos 1° y 4°', N'Solicitar la evaluación inicial del Sistema de Gestión de Seguridad y Salud en el Trabajo.
Mediante la matriz legal, matriz de peligros, identificación de amenazas, verificación de controles, reporte de peligros, lista de asistencia a capacitaciones, análisis de puestos de trabajo, exámenes médicos iniciales y periódicos y seguimiento de indicadores, entre otros.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (15, 6, N'La empresa diseña y define un plan de trabajo anual para el cumplimiento del Sistema de Gestión de Seguridad y Salud en el Trabajo, el cual identifica los objetivos, metas, responsabilidades, recursos, cronograma de actividades y debe estar firmado por el empleador y el responsable del Sistema de Gestión de Seguridad y Salud en el Trabajo.', N'2.4.1 Plan que identifica objetivos metas, responsabilidad, recursos con cronograma y firmado.', N'2.4.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.8. numeral 7, 2.2.4.6.12. numeral 5, 2.2.4.6.17. numeral 2.3 y parágrafo 2°, 2.2.4.6.20. numeral 3, 2.2.4.6.21. numeral 2, 2.2.4.6.22. numeral 3', N'Solicitar el plan de trabajo anual para alcanzar los objetivos propuestos en el Sistema de Gestión de Seguridad y Salud en el Trabajo, el cual identifica metas, responsabilidades, recursos, cronograma de actividades, firmado por el empleador y el responsable del Sistema de Gestión de Seguridad y Salud en el Trabajo. Verificar el cumplimiento del mismo. En caso de desviaciones en el cumplimiento, solicitar los planes de mejora para el logro del plan inicial.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (16, 7, N'La empresa cuenta con un sistema de archivo o retención documental, para los registros y documentos que soportan el Sistema de Gestión de Seguridad y Salud en el Trabajo', N'2.5.1 Archivo o retención documental del Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST.', N'2.5.1', N'Decreto 1072/2015 Artículo. 2.2.4.6.13. Archivo General de la Nación en el Acuerdo 48 del 2000, Acuerdo 49 del 2000, Acuerdo 50 del 2000 y la Ley 594 del 2000 (Ley General de Archivos para Colombia)', N'Constatar la existencia de un sistema de archivo o retención documental, para los registros y documentos que soportan el Sistema de Gestión de Seguridad y Salud en el Trabajo.
Verificar mediante muestreo que los registros y documentos sean legibles (entendible para el lector objeto), fácilmente identificables y accesibles (para todos los que estén vinculados con cada documento en particular), protegidos contra daño y pérdida.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (17, 8, N'Quienes tengan responsabilidad sobre el Sistema de Gestión de Seguridad y Salud en el Trabajo rinden cuentas anualmente sobre su desempeño.', N'2.6.1 Rendición sobre el desempeño', N'2.6.1', N'Decreto 1072/2015 Artículo. 2.2.4.6.8. numeral 3', N'Solicitar los registros documentales que evidencien la rendición de cuentas anual, al interior de la empresa.
Solicitar a la empresa los mecanismos de rendición de cuentas que haya definido y verificar que se haga y se cumplan con los criterios del requisito.
La rendición de cuentas debe incluir todos los niveles de la empresa ya que en cada uno de ellos hay responsabilidades sobre la Seguridad y Salud en el Trabajo')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (18, 9, N'La empresa define la matriz legal actualizada que contemple las normas del Sistema General de Riesgos Laborales aplicables a la empresa.', N'2.7.1 Matriz legal.', N'2.7.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.8. numeral 5, 2.2.4.6.12. numeral 15, 2.2.4.6.17. numeral 1.1', N'Solicitar la matriz legal en la cual se contemple la legislación nacional vigente en materia de riesgos laborales.
Verificar que contenga:
Normas vigentes en riesgos laborales, aplicables a la empresa.
Normas técnicas de cumplimiento de acuerdo con los peligros / riesgos identificados en la empresa.
Normas vigentes de diferentes entidades que le aplique.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (19, 10, N'La empresa dispone de mecanismos eficaces para recibir y responder las comunicaciones internas y externas relativas a la Seguridad y Salud en el Trabajo, como por ejemplo autoreporte de condiciones de trabajo y de salud por parte de los trabajadores o contratistas.', N'2.8.1 Mecanismos de comunicación, auto reporte en Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST.', N'2.8.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.14. 2.2.4.6.16. Parágrafo 3
2.2.4.6.28. numeral 2 2.2.4.6.16. Parágrafo 3 2.2.4.6.28. numeral 2', N'Constatar la existencia de mecanismos de comunicación interna y externa que tiene la empresa en materia de Seguridad y Salud en el Trabajo y comprobar que las acciones que se desarrollaron para dar respuesta a las comunicaciones recibidas son eficaces.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (20, 11, N'La empresa estableció un procedimiento para la identificación y evaluación de las especificaciones en Seguridad y Salud en el Trabajo, de las compras y adquisición de productos y servicios, como por ejemplo los elementos de protección personal.', N'2.9.1 Identificación, evaluación para adquisición de productos y servicios en Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST', N'2.9.1', N'Decreto 1072/2015 Artículo 2.2.4.6.27 Resolución 2400/1979 Artículos 177 y 178.', N'Verificar el cumplimiento del procedimiento para la identificación y evaluación de las especificaciones en Seguridad y Salud en el Trabajo de las compras o adquisición de productos y servicios, como por ejemplo los elementos de protección personal. Verificar la existencia de la matriz de elementos de protección personal.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (21, 12, N'La empresa incluye los aspectos de Seguridad y Salud en el Trabajo en la evaluación y selección de proveedores y contratistas.', N'2.10.1 Evaluación y selección de proveedores y contratistas', N'2.10.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.4. parágrafo 2°, 2.2.4.6.28. numeral 1', N'Constatar que para la selección y evaluación de proveedores y/o contratistas, se valida que dichos proveedores o contratistas tienen documentado e implementado el Sistema de Gestión de Seguridad y Salud en el Trabajo y que conocen los peligros/riesgos y la forma de controlarlos al ejecutar el servicio por realizar en la empresa dónde prestan el servicio.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (22, 13, N'La empresa dispone de un procedimiento para evaluar el impacto sobre la Seguridad y Salud en el Trabajo que se pueda generar por cambios internos o externos.', N'2.11.1 Evaluación del impacto de cambios internos y externos en el Sistema de Gestión de Seguridad y Salud en el Trabajo - SG -SST.', N'2.11.1', N'Decreto 1072/2015 Artículo 2.2.4.6.26', N'Solicitar el documento para evaluar el impacto sobre la Seguridad y Salud en el Trabajo en cambios internos y externos que se presenten en la entidad.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (23, 14, N'Hay como mínimo, la siguiente información actualizada de todos los trabajadores, del último año: la descripción socio demográfica de los trabajadores (edad, sexo, escolaridad, estado civil), la caracterización de sus condiciones de salud, la evaluación y análisis de las estadísticas sobre la salud de los trabajadores tanto de origen laboral como común, y los resultados de las evaluaciones médicas ocupacionales.', N'3.1.1 Evaluación Médica Ocupacional', N'3.1.1', N'Resolución 2346/2007 Artículo 8°. Artículo 15 Artículo. 18. Decreto 1072/2015 Artículos: 2.2.4.2.2.18 2.2.4.6.12. numeral 4 2.2.4.6.13 numerales 1 y 2, 2.2.4.6.16. numeral 7 y parágrafo 1°.', N'Solicitar el documento consolidado que evidencie el cumplimiento de lo requerido en el criterio.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (24, 14, N'Están definidas y se llevaron a cabo las actividades de medicina del trabajo, promoción y prevención, de conformidad con las prioridades que se identificaron en el diagnóstico de las condiciones de salud de los trabajadores y los peligros/riesgos de intervención prioritarios', N'3.1.2 Actividades de Promoción y Prevención en Salud.', N'3.1.2', N'Resolución 2346/2007 Artículo 18. Decreto 1072/2015 Artículos: 2.2.4.6.8. numeral 8, 2.2.4.6.12. numerales 4, 13 y 16 2.2.4.6.20. numeral 9 2.2.4.6.21. numeral 5, 2.2.4.6.24. Parágrafo 3', N'Solicitar las evidencias que constaten la definición y ejecución de las actividades de medicina del trabajo, promoción y prevención de conformidad con las prioridades que se identificaron con base a los resultados del diagnóstico de las condiciones de salud y los peligros/riesgos de intervención prioritarios.
Solicitar el programa de vigilancia epidemiológica de los trabajadores.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (25, 14, N'Se informa al médico que realiza las evaluaciones ocupacionales los perfiles del cargo, con una descripción de las tareas y el medio en el cual se desarrollará la labor respectiva.', N'3.1.3 Información al médico de los perfiles de cargo.', N'3.1.3', N'Resolución 2346/2007 Artículo 4°.', N'Verificar que al médico que realiza las evaluaciones ocupacionales, se le remitieron los soportes documentales respecto de los perfiles del cargo, descripción de las tareas y el medio en el cual desarrollará la labor los trabajadores.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (26, 14, N'Se realizan las evaluaciones médicas de acuerdo con la normativa y los peligros a los cuales se encuentre expuesto el trabajador.
Asimismo, se tiene definida la frecuencia de las evaluaciones médicas ocupacionales periódicas según tipo, magnitud, frecuencia de exposición a cada peligro, el estado de salud del trabajador, las recomendaciones de los sistemas de vigilancia epidemiológica y la legislación vigente.
Los resultados de las evaluaciones médicas ocupacionales serán comunicados por escrito al trabajador y constarán en su historia médica.', N'3.1.4 Realización de los exámenes médicos ocupacionales - Peligros. Periodicidad', N'3.1.4', N'Resolución 2346/2007 Artículo 5°. Decreto 1072/2015 Artículos: 2.2.4.6.12. numeral 4 y 13. 2.2.4.6.24. parágrafo 3 Resolución 957/2005 Comunidad Andina de Naciones Artículo. 17', N'Solicitar los conceptos de aptitud que demuestren la realización de las evaluaciones médicas.
Solicitar el documento o registro que evidencie la definición de la frecuencia de las evaluaciones médicas periódicas.
Solicitar el documento que evidencie la comunicación por escrito al trabajador de los resultados de las evaluaciones médicas ocupacionales.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (27, 14, N'La empresa debe tener la custodia de las historias clínicas a cargo de una institución prestadora de servicios en Seguridad y Salud en el Trabajo o del médico que practica los exámenes laborales en la empresa.', N'3.1.5 Custodia de Historias Clínicas', N'3.1.5', N'Resolución 2346/2007 Artículos 16 y 17 modificado por la Resolución 1918/2009 Artículo 2° Decreto 1072/2015 Artículo 2.2.4.6.13 numerales 1 y 2', N'Evidenciar los soportes que demuestren que la custodia de las historias clínicas esté a cargo de una institución prestadora de servicios en Seguridad y Salud en el Trabajo o del médico que practica los exámenes laborales en la empresa.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (28, 14, N'La empresa acata las restricciones y recomendaciones médico-laborales por parte de la Empresa Promotora de Salud (EPS) o Administradora de Riesgos Laborales (ARL) prescritas a los trabajadores para la realización de sus funciones.
Asimismo, y de ser necesario, se adecua el puesto de trabajo, se reubica al trabajador o realiza la readaptación laboral.
Se anexa soportes de entrega a quienes califican en primera oportunidad y/o a las Juntas de Calificación de Invalidez los documentos que son responsabilidad del empleador que trata la norma para la calificación de origen y porcentaje de la pérdida de la capacidad laboral.', N'3.1.6 Restricciones y recomendaciones medico/laborales', N'3.1.6', N'Decreto 2177/1989 Artículo. 16 Ley 776/2002 Artículos 4° y 8° Resolución 2844/ 2007 Artículo 1°, parágrafo. Resolución 1013/ 2008 Artículo 1°, parágrafo. Manual de procedimientos para la rehabilitación y reincorporación ocupacional. Decreto 1072/2015 Artículo 2.2.5.1.28.', N'Solicitar documento de recomendaciones y restricciones a trabajadores y revisar que la empresa ha acatado todas las recomendaciones y restricciones médico-laborales prescritas a to-
dos los trabajadores y ha realizado las acciones que se requieran en materia de reubicación o readaptación.
Solicitar documento de soporte de recibido por parte de quienes califican en primera oportunidad y/o a las Juntas de Calificación de Invalidez.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (29, 14, N'Hay un programa para promover entre los trabajadores estilos de vida y entorno saludable, incluyendo campañas específicas tendientes a la prevención y el control de la farmacodependencia, el alcoholismo y el tabaquismo, entre otros.', N'3.1.7 Estilo de vida y entornos saludables (controles tabaquismo, alcoholismo fármaco-dependencia y otros).', N'3.1.7', N'Decreto 1295/1994 Artículo 35 numeral d) Ley 1562/2012 Artículo 11 literal f) Resolución 1075/1992 Artículo 1 Ley 1355 de 14 de octubre de 2009, Artículo 5 parágrafo.', N'Solicitar el programa respectivo y los documentos y registros que evidencien el cumplimiento del mismo.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (30, 14, N'En la sede hay suministro permanente de agua potable, servicios sanitarios y mecanismos para disponer excretas y basuras.', N'3.1.8 Agua potable, servicios sanitarios y disposición de basuras.', N'3.1.8', N'Ley 9 /1979 Artículo. 10, 36, 129 y 285 Resolución 2400/1979 Artículo 24, 42', N'Mediante observación directa, verificar si se cumple lo que se exige en el criterio, dejando prueba fotográfica o fílmica al respecto.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (31, 14, N'La empresa elimina los residuos sólidos, líquidos o gaseosos que se producen, así como los residuos peligros de forma que no se ponga en riesgo a los trabajadores.', N'3.1.9 Eliminación adecuada de residuos sólidos, líquidos o gaseosos', N'3.1.9', N'Ley 9 /1979 Artículos 10, 22 y 129', N'Mediante observación directa, constatar las evidencias en las que se dé cuenta de los procesos de eliminación de residuos conforme al criterio y solicitar contrato de empresa que elimina y dispone de los residuos peligrosos.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (32, 15, N'La empresa reporta a la Administradora de Riesgos Laborales (ARL), a la Entidad Promotora de Salud (EPS) todos los accidentes y las enfermedades laborales diagnosticadas. Asimismo, reportará a la Dirección Territorial el accidente grave y mortal, como las enfermedades diagnosticadas como laborales.
Estos reportes se realizarán dentro de los dos (2) días hábiles siguientes al evento o recibo del diagnóstico de la enfermedad.', N'3.2.1 Reporte de los Accidentes de Trabajo y Enfermedad Laboral a la ARL, EPS y Dirección Territorial del Ministerio del Trabajo.', N'3.2.1', N'Resolución 1401/2007 Artículo 14 Decreto Ley 19/2012 Artículo 140 Decreto 1295/1994 Artículo 21 literal e) y Artículo 62 Resolución 156/2005 Resolución 2851/2015 Artículo 1° Decreto 1072/2015 Artículos: 2.2.4.6.12. numeral 11, 2.24.6.21 numeral 9, 2.2.4.2.4.5 2.2.4.1.7', N'Indagar con los trabajadores, si se han presentado accidentes de trabajo o enfermedades laborales (en caso afirmativo, tomar los datos de nombre y número de cédula y solicitar el reporte). Igualmente realizar un muestreo del reporte de registro de accidente de trabajo (Furat) y el registro de enfermedades laborales (Furel) respectivo, verificando si el reporte a las Ad-
ministradoras de Riesgos Laborales, Empresas Promotoras de Salud y Dirección Territorial se hizo dentro de los dos (2) días hábiles siguientes al evento o recibo del diagnóstico de la enfermedad.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (33, 15, N'La empresa investiga todos los accidentes e incidentes de trabajo y las enfermedades cuando sean diagnosticadas como laborales, determinando las causas básicas e inmediatas y la posibilidad de que se presenten nuevos casos.', N'3.2.2 Investigación de Accidentes, Incidentes y Enfermedad Laboral.', N'3.2.2', N'Resolución 1401/2007 Artículo 4 numerales 2, 3 y 4, Artículo 7°. Artículo 14 Decreto 1072/2015 Artículos: 2.2.4.1.6 2.2.4.6.21. numeral 9, 2.2.4.6.32.', N'Verificar por medio de un muestreo si se investigan los accidentes e incidentes de trabajo y las enfermedades laborales y si se definieron acciones para otros trabajadores potencialmente expuestos.
Constatar que la investigación se haya realizado dentro de los quince (15) días siguientes a su ocurrencia a través del equipo investigador y evidenciar que se hayan remitido los informes de las investigaciones de accidente de trabajo grave o mortal o una enfermedad laboral mortal.
En caso de haber accidente grave o se produzca la muerte verificar la participación de un profesional con licencia Salud Ocupacional o en Seguridad y Salud en el Trabajo en la investigación (propio o contratado), así como del Comité Paritario o Vigía de Seguridad y Salud en el Trabajo.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (34, 15, N'Hay un registro estadístico de los incidentes y de los accidentes de trabajo, así como de las enfermedades laborales que ocurren; se analiza este registro y las conclusiones derivadas del estudio son usadas para el mejoramiento del Sistema de Gestión de Seguridad y Salud en el Trabajo.', N'3.2.3 Registro y análisis estadístico de incidentes, Accidentes de trabajo y Enfermedad Laboral.', N'3.2.3', N'Decreto 1072/2015 Artículos: 2.2.4.6.16. numeral 7, 2.2.4.6.21. numeral 10, 2.2.4.6.22. numeral 8. Decreto 1295/1994 Artículo 61', N'Solicitar el registro estadístico actualizado de lo corrido del año y el año inmediatamente anterior al de la visita, así como la evidencia que contiene el análisis y las conclusiones derivadas del estudio que son usadas para el mejoramiento del SG-SST.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (35, 16, N'La empresa mide la severidad de los accidentes de trabajo como mínimo una vez al año y realiza la clasificación del origen del peligro/riesgo que los generó (físicos, químicos, biológicos, de seguridad, públicos, psicosociales, entre otros).', N'3.3.1 Medición de la severidad de los Accidentes de Trabajo y Enfermedad Laboral', N'3.3.1', N'Resolución 1401/2007 Artículo 4° Decreto 1072/2015 Artículo 2.2.4.6.2 nums. 7, 18 y 34', N'Solicitar los resultados de la medición para lo corrido del año y/o el año inmediatamente anterior y constatar el comportamiento de la severidad y la relación del evento con los peligros/riesgos.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (36, 16, N'La empresa mide la frecuencia de los accidentes e incidentes de trabajo y enfermedad laboral como mínimo una vez al año y realiza la clasificación del origen del peligro/riesgo que los generó (físicos, de químicos, biológicos, seguridad, públicos, psicosociales, entre otros.)', N'3.3.2 Medición de la frecuencia de los incidentes, Accidentes de Trabajo y Enfermedad Laboral', N'3.3.2', N'Resolución 1401/2007 Artículo 4° Decreto 1072/2015 Artículos: 2.2.4.6.21. numeral 10', N'Solicitar los resultados de la medición para lo corrido del año y/o el año inmediatamente anterior y constatar el comportamiento de la frecuencia de los accidentes y la relación del evento con los peligros/riesgos.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (37, 16, N'La empresa mide la mortalidad por accidentes de trabajo y enfermedades laborales como mínimo una vez al año y realiza la clasificación del origen del peligro/riesgo que los generó (físicos, químicos, biológicos, de seguridad, públicos, psicosociales, entre otros)', N'3.3.3 Medición de la mortalidad de Accidentes de Trabajo y Enfermedad Laboral.', N'3.3.3', N'Resolución 1401/2007 Artículo 4° Decreto 1072/2015 Artículos: 2.2.4.6.21 numeral 10', N'Solicitar los resultados de la medición para lo corrido')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (38, 16, N'La empresa mide la prevalencia de la enfermedad laboral como mínimo una vez al año y realiza la clasificación del origen del peligro/riesgo que la generó (físico, químico, biológico, ergonómico o biomecánico, psicosocial, entre otros)', N'3.3.4 Medición de la prevalencia de incidentes, Accidentes de Trabajo y Enfermedad Laboral', N'3.3.4', N'Decreto 1072/2015 Artículos: 2.2.4.6.21. numeral 10', N'Solicitar los resultados de la medición para lo corrido del año y/o el año inmediatamente anterior y constatar el comportamiento de la prevalencia de las enfermedades laborales y la relación del evento con los peligros/riesgos.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (39, 16, N'La empresa mide la incidencia de la enfermedad laboral como mínimo una vez al año y realiza la clasificación del origen del peligro/riesgo que la generó (físicos, químicos, biológicos, ergonómicos o biomecánicos, psicosociales, entre otros)', N'3.3.5 Medición de la incidencia de incidentes, Accidentes de Trabajo y Enfermedad Laboral.', N'3.3.5', N'Decreto 1072/2015 Artículos: 2.2.4.6.21 numeral 10', N'Solicitar los resultados de la medición para lo corrido del año y/o el año inmediatamente anterior y constatar el comportamiento de la incidencia de las enfermedades laborales y la relación del evento con los peligros/riesgos.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (40, 16, N'La empresa mide el ausentismo por enfermedad laboral y común y por accidente de trabajo, como mínimo una vez al año y realiza la clasificación del origen del peligro/riesgo que lo generó (físicos, ergonómicos, o biomecánicos, químicos, de seguridad, públicos, psicosociales, entre otros)', N'3.3.6 Medición del ausentismo por incidentes, Accidentes de Trabajo y Enfermedad Laboral.', N'3.3.6', N'Decreto 1072/2015 Artículos: 2.2.4.6.21 numeral 10', N'Solicitar los resultados de la medición para lo corrido del año y/o el año inmediatamente anterior y constatar el comportamiento del ausentismo y la relación del evento con los peligros/riesgos.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (41, 17, N'La empresa tiene definida y aplica una metodología para la identificación de peligros y evaluación y valoración de los riesgos de origen físico, ergonómico o biomecánico, biológico,
químico, de seguridad, público, psicosocial, entre otros, con alcance sobre todos los procesos, actividades rutinarias y no rutinarias, maquinaria y equipos en todos los centros de trabajo y en todos los trabajadores independientemente de su forma de vinculación y/o contratación.
Identificar con base en la valoración de los riesgos, aquellos que son prioritarios.', N'4.1.1 Metodología para la identificación, evaluación y valoración de peligros', N'4.1.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.15., 2.2.4.6.16. numeral 2.', N'Verificar que se realiza la identificación de peligros, evaluación y valoración de los riesgos conforme a la metodología definida de acuerdo con el criterio y con la participación de los trabajadores, seleccionando de manera aleatoria algunas de las actividades identificadas.
Confrontar mediante observación directa durante el recorrido a las instalaciones de la empresa la identificación de peligros.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (42, 17, N'La identificación de peligros, evaluación y valoración del riesgo se desarrolló con la participación de trabajadores de todos los niveles de la empresa y es actualizada como mínimo una vez al año y cada vez que ocurra un accidente de trabajo mortal o un evento catastrófico en la empresa o cuando se presenten cambios en los procesos, en las instalaciones, o maquinaria o equipos.', N'4.1.2 Identificación de peligros con participación de todos los niveles de la empresa.', N'4.1.2', N'Decreto 1072/2015 Artículo. 2.2.4.6.15. Parágrafo 1 2.2.4.6.23', N'Verificar que estén identificados los peligros, evaluados y valorados los riesgos, con la participación de los trabajadores.
Solicitar si hay eventos mortales o catastróficos y validar que el peligro asociado al evento esté identificado, evaluado y valorado.
En caso de que se encuentren valoraciones no tolerables, verificar la implementación de las acciones de intervención y control, de forma inmediata para continuar con la tarea.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (43, 17, N'La empresa donde se procese, manipule o trabaje con agentes o sustancias catalogadas como carcinógenas o con toxicidad aguda, causantes de enfermedades, incluidas en la tabla de enfermedades laborales, prioriza los riesgos asociados a estas sustancias o agentes y realiza acciones de prevención e intervención al respecto.', N'4.1.3 Identificación y priorización de la naturaleza de los peligros (Metodología adicional- cancerígenos y otros).', N'4.1.3', N'Ley 1562/2012 Artículo 9° Decreto 1072/2015 Artículo 2.2.4.6.15. parágrafo 2°.', N'Revisar la lista de materias primas e insumos, productos intermedios o finales, subproductos y desechos y verificar si estas son o están compuestas por agentes o sustancias catalogadas como carcinógenas en el grupo 1 de la clasificación de la Agencia Internacional de Investigación sobre el Cáncer (International Agency for Research on Cancer, IARC) o con toxicidad aguda según los criterios del Sistema Globalmente Armonizado (categorías I y II).
Se debe verificar que los riesgos asociados a estas sustancias o agentes carcinógenos o con toxicidad aguda son priorizados y se realizan acciones de prevención e intervención.
Asimismo, se debe verificar la existencia de áreas destinadas para el almacenamiento de las materias primas e insumos y sustancias catalogadas como carcinógenas o con toxicidad aguda.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (44, 17, N'Se realizan mediciones ambientales de los riesgos prioritarios, provenientes de peligros químicos, físicos y/o biológicos.', N'4.1.4 Realización mediciones ambientales químicos, físicos y biológicos.', N'4.1.4', N'Decreto 1072/2015 Artículos: 2.2.4.6.15. Resolución 2400/1979 Título III', N'Verificar los soportes documentales de las mediciones ambientales realizadas y la remisión de estos resultados al Comité Paritario en Seguridad y Salud en el Trabajo o al Vigía de Seguridad y Salud en el Trabajo.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (45, 18, N'Se implementan las medidas de prevención y control con base en el resultado de la identificación de peligros, la evaluación y valoración de los riesgos (físicos, ergonómicos, biológicos, químicos, de seguridad, públicos, psicosociales, entre otros), incluidos los prioritarios y éstas se ejecutan acorde con el esquema de jerarquización, de ser factible priorizar la intervención en la fuente y en el medio.', N'4.2.1 Se implementan medidas de prevención y control / peligros.', N'4.2.1', N'Decreto 1072/2015 Artículos 2.2.4.6.15, 2.2.4.6.24 Resolución 2400/1979 Capítulo I al VII Artículos del 63 al 152 Ley 9/1979 Artículos 105 al 109.', N'Verificar la implementación de las medidas de prevención y control, de acuerdo al esquema de jerarquización y de conformidad con la identificación de los peligros, la evaluación y valoración de los riesgos (físicos, ergonómicos, biológicos, químicos, de seguridad, públicos, psicosociales, entre otros), realizada.
Verificar que estas medidas se encuentran programadas en el plan anual de trabajo. Constatar que se dio preponderancia a las medidas de prevención y control, respecto de los peligros/riesgos prioritarios.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (46, 18, N'Se verifica la aplicación por parte de los trabajadores de las medidas de prevención y control de los peligros /riesgos (físicos, ergonómicos, biológicos, químicos, de seguridad, públicos, psicosociales, entre otros).', N'4.2.2 Se verifica aplicación de las medidas prevención y control', N'4.2.2', N'Decreto 1072/2015 Artículos: 2.2.4.6.10, 2.2.4.6.24. parágrafo 1, 2.2.4.6.28 numeral 6 Resolución 2400/1979 Artículo 3°, capítulos I al VII del Título III Artículos del 63 al 152 Ley 9/1979 Artículos del 105 al 109', N'Solicitar los soportes documentales implementados por la empresa donde se verifica el cumplimiento de las responsabilidades de los trabajadores frente a la aplicación de las medidas de prevención y control de los peligros/riesgos (físicos, ergonómicos, biológicos, químicos, de seguridad, públicos, psicosociales, entre otros).
Realizar visita a las instalaciones para verificar el cumplimiento de las medias de prevención y control por parte de los trabajadores de acuerdo con lo enunciado en los planes de prevención y control descritos.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (47, 18, N'La empresa para los peligros identificados ha estructurado programa de prevención y protección de la seguridad y salud de las personas (incluye procedimientos, instructivos, fichas técnicas).', N'4.2.3 Hay procedimientos, instructivos, fichas, protocolos.', N'4.2.3', N'Decreto 1072/2015 Artículo 2.2.4.6.12 numerales 7 y 9', N'Solicitar los procedimientos, instructivos, fichas técnicas cuando aplique y protocolos de Seguridad y Salud en el Trabajo,')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (48, 18, N'Se realizan inspecciones sistemáticas a las instalaciones, maquinaria o equipos, incluidos los relacionados con la prevención y atención de emergencias; con la participación del Comité Paritario o Vigía de Seguridad y Salud en el Trabajo.', N'4.2.4 Inspección con el COPASST o Vigía', N'4.2.4', N'Decreto 1072/2015, Artículos: 2.2.4.6.12 numeral 14, 2.2.4.6.24 parágrafos 1° y 2°, 2.2.4.6.25 numeral 12', N'Solicitar la evidencia de las inspecciones realizadas a las instalaciones, maquinaria y equipos, incluidos los relacionados con la prevención y atención de emergencias y verificar la participación del Comité Paritario o Vigía de Seguridad y Salud en el Trabajo.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (49, 18, N'Se realiza el mantenimiento periódico de las instalaciones, equipos y herramientas, de acuerdo con los informes de las inspecciones o reportes de condiciones inseguras.', N'4.2.5 Mantenimiento periódico de instalaciones, equipos, máquinas, herramientas', N'4.2.5', N'Decreto 1072/2015 Artículos: 2.2.4.6.12 numeral 14, 2.2.4.6.24 parágrafos 1° y 2, 2.2.4.6.25 numeral 12', N'Solicitar la evidencia del mantenimiento preventivo y/o correctivo en las instalaciones, equipos y herramientas de acuerdo con los manuales de uso de estos y los informes de las inspecciones o reportes de condiciones inseguras.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (50, 18, N'Se les suministran a los trabajadores que lo requieran los Elementos de Protección Personal y se les reponen oportunamente conforme al desgaste y condiciones de uso de los mismos.
Se verifica que los contratistas y subcontratistas que tengan trabajadores realizando actividades en la empresa, en su proceso de producción o de prestación de servicios se les entrega los Elementos de Protección Personal y se hace reposición oportunamente conforme al desgaste y condiciones de uso de los mismos.
Se realiza la capacitación para el uso de los Elementos de Protección Personal', N'4.2.6 Entrega de Elementos de Protección Personal - EPP, se verifica con contratistas y subcontratistas.', N'4.2.6', N'Decreto 1072/2015 Artículos: 2.2.4.2.4.2. 2.2.4.2.2.16 2.2.4.6.12. numeral 8, 2.2.4.6.13. numeral 4, 2.2.4.6.24. Numeral 5 y parágrafo 1. Resolución 2400/1979 Artículo 2 literales f) y g), Artículos 176,177 y 178. Ley 9 /1979 Artículo del 122 al 124.', N'Solicitar los soportes que evidencien la entrega y reposición de los Elementos de Protección Personal a los trabajadores.
Asimismo, verificar los soportes que den cuenta del cumplimiento del criterio por parte de los contratistas y subcontratistas.
Verificar los soportes que evidencien la realización de la capacitación en el uso de los Elementos de Protección Personal.
Establecer si hay documentos escritos o pruebas de la entrega de los elementos de protección personal a los trabajadores.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (51, 19, N'Se tiene un plan de prevención, preparación y respuesta ante emergencias que identifica las amenazas, evalúa y analiza la vulnerabilidad, incluye planos de las instalaciones que identifican áreas y salidas de emergencia, así como la señalización debida, simulacros como mínimo una vez al año y este es divulgado. Se tienen en cuenta todas las jornadas de trabajo en todos los centros de trabajo', N'5.1.1 Se cuenta con el Plan de Prevención y Preparación ante emergencias', N'5.1.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.12. numeral 12, 2.2.4.6.25. 2.2.4.6.28. numeral 4', N'Solicitar el plan de prevención, preparación y respuesta ante emergencias, constatar su divulgación.
Verificar si existen los planos de las instalaciones que identifican áreas y salidas de emergencia y verificar si existe la debida señalización de la empresa y los soportes que evidencien la realización de los simulacros.
Verificar la realización de simulacros y análisis del mismo, validar que las mejoras hayan sido tenidas en cuenta en el mejoramiento del plan.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (52, 19, N'Se encuentra conformada, capacitada y dotada la brigada de prevención, preparación y respuesta ante emergencias, organizada según las necesidades y el tamaño de la empresa (primeros auxilios, contra incendios, evacuación, etc.).', N'5.1.2 Brigada de prevención conformada, capacitada y dotada', N'5.1.2', N'Decreto 1072/2015 Artículo 2.2.4.6.25 numeral 11', N'Solicitar el documento de conformación de la brigada de prevención, preparación y respuesta ante emergencias y verificar los soportes de la capacitación y entrega de la dotación.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (53, 20, N'El empleador tiene definidos los indicadores de estructura, proceso y resultado del Sistema de Gestión de Seguridad y Salud en el Trabajo.', N'6.1.1 Indicadores estructura, proceso y resultado.', N'6.1.1', N'Decreto 1072/2015 Artículos: 2.2.4.6.19., 2.2.4.6.20., 2.2.4.6.21., 2.2.4.6.22.', N'Solicitar los indicadores de estructura, proceso y resultado del Sistema de Gestión de Seguridad y Salud en el Trabajo que se encuentren alineados al plan estratégico de la empresa.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (54, 20, N'El empleador debe realizar una auditoría anual, la cual será planificada con la participación del Comité Paritario o Vigía de Seguridad y Salud en el Trabajo.', N'6.1.2 La empresa adelanta auditoría por lo menos una vez al año.', N'6.1.2', N'Decreto 1072/2015 Artículo 2.2.4.6.29.', N'La empresa adelantará por lo menos una vez al año, un ciclo completo de auditorías internas al SG-SST, en donde su alcance deberá incluir todas las áreas.
Solicitar el programa de la auditoría, el alcance de la auditoría, la periodicidad, la metodología y la presentación de informes y verificar que se haya planificado con la participación del Comité Paritario o Vigía de Seguridad y Salud en el Trabajo.')
GO
INSERT [dbo].[Tbl_Criterios] ([Pk_Id_Criterio], [Fk_Id_SubEstandar], [Descripcion], [Descripcion_Corta], [Numeral], [Marco_Legal], [Modo_Verificacion]) VALUES (55, 20, N'Alcance de la auditoría de cumplimiento del Sistema de Gestión de Seguridad y Salud en el Trabajo.', N'6.1.3 Revisión anual por la alta dirección, resultados y alcance de la auditoría.', N'6.1.3', N'Decreto 1072/2015 Artículo 2.2.4.6.30', N'Se debe solicitar a la empresa los documentos, pruebas de la realización de actividades y obligaciones establecidas en los trece numerales del artículo 2.2.4.6.30 del Decreto 1072/2015')
